In TypeScript, you can achieve this using various techniques, depending on your specific use case. Here are a few approaches:

**1. **Union type with a narrowing context**:
When you're certain that the value will be narrowed to a specific type within a particular scope, use a union type and let the type system infer the narrower type later on.

Example:
```ts
let value: string | number;
// assume value will always be a string in this function's scope
function processValue(value: string | number) {
  if (/* some condition */) {
    console.log(value.toString()); // now TypeScript knows `value` is a string
  }
}
```
In this example, the type checker is aware that within the `processValue` function, `value` will always be a string (even though it's declared as a union type initially).

**2. **Type assertions**:
Use the `as` keyword for an explicit type assertion. This tells TypeScript to trust you that you know what you're doing, but keep in mind that losing type safety at this point.

Example:
```ts
let value: string | number;
let narrowedValue = value as string; // assert value is a string (though not checked at compile-time)
```
**3. **Enums with a single value** (a TypeScript-specific approach):
If you have a finite set of values with a single "effective" value, consider using an enum with a single value.

Example:
```ts
enum SingleValueEnum {
  ONLY_ONE = 'stringValue', // only one value, guaranteed
}

let value: SingleValueEnum;
value = 'stringValue'; // TypeScript knows value is SingleValueEnum ONLY_ONE (a string)
```
**4. **Custom type guards** (advanced):
Create a custom function that returns a type predicate (a function returning a boolean and a type) using the `is` type. This allows you to narrow the type within a specific scope.

Example:
```ts
type StringOnly = {
  isStringOnly(): value is string;
}

function isStringOnly(value: string | number): value is string {
  return typeof value === 'string';
}

let value: string | number;
if (isStringOnly(value)) {
  console.log(value.toString()); // now TypeScript knows `value` is a string
}
```
Choose the approach that best fits your use case. Remember to use these techniques judiciously, as ignoring type safety can lead to errors at runtime if your assumptions are broken.

In summary, TypeScript provides various ways to convey your knowledge about a value's actual type, while still maintaining a balance between type safety and pragmatism.

